import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import Image from "react-bootstrap/Image";

const Weather = () => {
  return (
    <Container>
      <Image src="holder.js/100px250" fluid />;
      <Row className="py-5 text-center">
        <Col sm="3" xs="2" md="6">
          One
        </Col>

        <Col sm="9" xs="10" md="6">
          Tow
        </Col>
      </Row>
    </Container>
  );
};

export default Weather;
